using System;using System.Data.Entity;using System.Collections.Generic;using System.Linq;using System.Web;namespace DBConnector.Models{	public class CalendarEvent	{		public int ID { get; set; }		public DateTime Date { get; set; }		public string Name { get; set; }		public CourseID Course { get; set; }		public Room Place { get; set; }		public EventType Type { get; set; }		public class EventDBContext : DbContext		{			public DbSet<CalendarEvent> Events { get; set; }		}	}	public enum EventType	{		Forelesning,		Innlevering,		Eksamen	}	public enum CourseID	{		PJ3100,		PG3300,		PG3400,		PG4200	}	public enum Room	{		Auditoriet,		Rom32,		Rom44,		Rom80,		Rom81	}}